"""
base64 与字节数组互转
"""
import base64
import struct


def bytes_to_base64url(java_byte_array):
    unsigned_byte_array = bytearray([byte & 0xFF for byte in java_byte_array])
    encode_string = base64.b64encode(unsigned_byte_array).decode('utf-8')
    encode_string = encode_string.replace("/", "_").replace("+", "-")
    print(encode_string)


def base64url_to_bytes(encode_string):
    encode_string = encode_string.replace("_", "/").replace("-", "+")
    sign_byte_array = base64.b64decode(encode_string)
    byte_array = [byte & 0xFF for byte in sign_byte_array]
    byte_data = bytes(byte_array)
    signed_byte_array = struct.unpack('b' * len(byte_data), byte_data)
    print(signed_byte_array)


